sys_variable_value.value:
(function execute(inputs, outputs) {
    var obj = JSON.parse(inputs['ResponseBody']);
    if (inputs.StatusCode == 200) {
        var namespaces = obj.value.map(function(item) {

            return {
                label: item.name,
                name: item.name
            };
        });
        outputs.namespaces = {
            data: namespaces
        };
    } else {
        outputs.namespaces = {
            data: []
        };
    }
})(inputs, outputs);

